import React, { useState , useEffect } from 'react'
import axios from 'axios'
import '../../Assets/Styles/Job/Job.css'

// import Job from './Jobs'

function Home() {
  const url = `https://dummyjson.com/products`
  const [products, setProducts] = useState({
    loading:false,
    data: null,
    error: false,
  })

  useEffect(() =>{ 
    setProducts({
      loading: true,
      data: null,
      error:false
    })

    axios.get(url)
      .then(response=>{
        setProducts({
          loading: false,
          data: response.data,
          error:false
        })
      })
      .catch(()=>{
        setProducts({
          loading: false,
          data: null,
          error:true

        })
      })
    }, [url])

    let content = null


    if(products.error){
     content = <p>Xəta baş verdi, zəhmət olmasa səhifəni yeniləyin və ya daha sonra müraciət edin.</p>
    }

    if(products.data){

    content = <div>{products.data.price}</div>
    }


    return (
      <div>
        products Lists
        {content}
    </div>


  )
}

export default Home
